class CommentNode extends Node {

  constructor(node, option) {
    super(node, option)
  }

  async getSource() {

    if (this._node.buffer) {
      // comment appears in html
      throw new UnsupportedCommentTransformError(this._node)
    } else {
      // comment appears in javascript
      return `//${this._node.val}`
    }

  }

}

export default CommentNode

import BlockNode from './block-node.js'
import Node from '../node.js'

import { UnsupportedCodeTransformError } from '../error/unsupported-code-transform-error.js'

class CodeNode extends Node {

  constructor(node, option) {
    super(node, option)
  }

  async getSource() {

    if (this._node.buffer) {

      if (this._node.mustEscape) {
        throw new UnsupportedCodeTransformError(this._node)
      } else {

        // return `__utility.addNode(${this._node.val}, __node)` // ${await CodeNode.convertToHyperScript(this._node.val)}, __node)`

        return  ` {
                    let value = ${this._node.val}
                    if (typeof value === 'string') {
                      __utility.addNode(__utility.convertToNode(value), __node)
                    } else {
                      __utility.addNode(value, __node)
                    }
                  }`

      }

    } else {

      if (this._node.block) {

        let blockNode = new BlockNode(this._node.block, this._option)
        let blockSource = blockNode.isEmpty ? '' : await blockNode.getSource()

        return  ` ${this._node.val} { 
                    ${blockSource}
                  }`

      } else {
        return this._node.val
      }

    }

  }

}

export default CodeNode

import Escape from 'jsesc'

import Node from '../node.js'

class TextNode extends Node {

  constructor(node, option) {
    super(node, option)
  }

  async getSource() {
    return this._node.val === '' ?
      '__utility.addNode(\'\', __node)' :
      this._node.val === '\n' ?
        '__utility.addNode(\'\\n\', __node)' :
        `__utility.addNode(__utility.convertToNode('${Escape(this._node.val)}'), __node)` // ${this._node.val}'), __node)` // 
  }

}

export default TextNode

import Node from '../node.js'

import { UnsupportedCommentTransformError } from '../error/unsupported-comment-transform-error.js'

class BlockCommentNode extends Node {

  constructor(node, option) {
    super(node, option)
  }

  async getSource() {

    if (this._node.buffer) {
      // comment appears in html
      throw new UnsupportedCommentTransformError(this._node)
    } else {

      // comment appears in javascript
      return this._node.block.nodes
        .filter((node) => node.type.toLowerCase() === 'text')
        .filter((node) => node.val != '\n')
        .map((node) => `// ${node.val}`)
        .join('\n')

    }

  }

}

export default BlockCommentNode

